import React from "react";
import vishal from "./imges/vishal.png"
import WavingHandIcon from '@mui/icons-material/WavingHand';
import Badge from 'react-bootstrap/Badge'; 
import { Col, Row } from "react-bootstrap";
function GridBox(){
    return(<Row className="grid">
<Col>
<img src={vishal} style={{width:"300px",height:"16em"}} alt=""/>
</Col>
<Col className="messages mb-3">

 <Badge bg="dark" className="p-4 rounded-5"> 
 <WavingHandIcon className="mr-2"/>
 Visitors I m Vishal
 </Badge>
 
      <Badge bg="warning" className="rounded-5 p-4">
        Vishnuj756@gmail.com
      </Badge>
</Col>
    </Row>)
}
export default GridBox;
